import React from 'react';
import './App.css';

export default class App extends React.Component {
  state = {
    pageTitle: 'privet',
    person: 'click me',
    newPage: 'smem privet',
  };

  render() {
    const styles = {
      border: '3px solid black',
      width: '100px',
      height: '50px',
      cursor: 'pointer',
      background: 'black',
      color: 'white',
      fontSize: '20px',
    };
    return <div className='App'></div>;
  }
}
